    "Data": "[\"3\",\"Novo conjunto de dados do ABoVE por Wang, C.\",\"Novo conjunto de dados do ABoVE por Wang, C.\",\"https://www.appsheet.com/image/getimageurl?appName=TDAD-4002500&tableName=Inicio&fileName=Inicio_Images%2F3.Imagen-.010546.png&appVersion=1.000201&signature=c5e4bc9c9f42c84d849a601dc54e81c75a070472d3ce77c2951bb58e590aade4\",\"https://www.appsheet.com/image/getimageurl?appName=TDAD-4002500&tableName=Inicio&fileName=Inicio_Images%2F3.Icon-.181035.png&appVersion=1.000201&signature=c111333998359ca3d059f575c4f5f335aebe6ec301ea2949158c90c79c6f2bb2\",\"Foi lançado recentemente mais uma leva de dados da campanha ABoVE, onde é detalhado e classificado a área do solo, principalmente das áreas de vegetação aquática e úmida sobre o Canadá. Nesses dados é incluído 4 mapas com 10 classes diferentes para cada solo, com cerca de 93,5% de precisão dos ambientes reais. Esses mapas servem para os profissionais fazerem uma melhor análise do meio e do ecossistema e assim criarem recursos para entender e prever as reações do meio ambiente decorrente das mudanças climáticas nas regiões do Ártico e Boreal.\",\"Noticia\"]",
