    "Data": "[[\"3\",\"⠀Novo conjunto de dados do ABoVE por Wang, C.\",\"Novo conjunto de dados do ABoVE por Wang, C.\",\"data:image/png;base64,\",\"https://www.appsheet.com/image/getimageurl?appName=TDAD-4002500&tableName=Inicio&fileName=Inicio_Images%2F3.Icon-.181035.png&appVersion=1.000200&signature=385f21c21a3eee8c904154054254428d1b51399c443c30bf783dcfa651760047\",\"Foi lançado recentemente mais uma leva de dados da campanha ABoVE, onde é detalhado e classificado a área do solo, principalmente das áreas de vegetação aquática e úmida sobre o Canadá. Nesses dados é incluído 4 mapas com 10 classes diferentes para cada solo, com cerca de 93,5% de precisão dos ambientes reais. Esses mapas servem para os profissionais fazerem uma melhor análise do meio e do ecossistema e assim criarem recursos para entender e prever as reações do meio ambiente decorrente das mudanças climáticas nas regiões do Ártico e Boreal.\",\"Noticia\"]]",
