    "Data": "[[\"2\",\"O que é a ABoVE?\",\"O que é a ABoVE?\",\"data:image/png;base64,\",\"Experimento  de Vulnerabilidade Ártico-Boreal (ABoVE) é uma campanha de campo do Programa de Ecologia Terrestre da NASA. Projeto conduzido no Alasca e Oeste do Canadá, iniciando-se em 2015.\\nO projeto ABoVE utiliza estudo de campo com dados geoespaciais, fornecendo uma base para a analise e os recursos de modelagem necessários para entender as respostas das mudanças climáticas nas regiões do Ártico e Boreal.\\nDados Geoespaciais -> Produtos derivados de sensores aéreos e de satélite\",\"Entenda\",\"https://www.appsheet.com/image/getimageurl?appName=TDAD-4002500&tableName=Inicio&fileName=Inicio_Images%2F2.Imagen-.152423.jpg&appVersion=1.000061&signature=981d068f8d43a1074238d93dec19d6d36cf4eb99422d447f372834c4fdc57a33\"]]",
