    "Data": "[\"2\",\"O que é a ABoVE?\",\"O que é a ABoVE?\",\"data:image/jpeg;base64,#filename=svgviewer-output_4.svg\",\"Experimento  de Vulnerabilidade Ártico-Boreal (ABoVE) é uma campanha de campo do Programa de Ecologia Terrestre da NASA. Projeto conduzido no Alasca e Oeste do Canadá, iniciando-se em 2015.\\nO projeto ABoVE utiliza estudo de campo com dados geoespaciais, fornecendo uma base para a analise e os recursos de modelagem necessários para entender as respostas das mudanças climáticas nas regiões do Ártico e Boreal.\\nDados Geoespaciais -> Produtos derivados de sensores aéreos e de satélite\",\"Entenda\",\"https://www.appsheet.com/image/getimageurl?appName=TDAD-4002500&tableName=Inicio&fileName=Inicio_Images%2F2.Imagen-.152423.jpg&appVersion=1.000057&signature=3a6ac9436afb1625aab72e8b877311eb5f01d38dfb57ae4cd8c148bdb010b579\"]",
