    "Data": "[\"2\",\"O que é a ABoVE?\",\"Experimento  de Vulnerabilidade Ártico-Boreal (ABoVE) é uma campanha de campo do Programa de Ecologia Terrestre da NASA. Projeto conduzido no Alasca e Oeste do Canadá, iniciando-se em 2015.\\nO projeto ABoVE utiliza estudo de campo com dados geoespaciais, fornecendo uma base para a analise e os recursos de modelagem necessários para entender as respostas das mudanças climáticas nas regiões do Ártico e Boreal.\\nDados Geoespaciais -> Produtos derivados de sensores aéreos e de satélite\",\"Entenda\",\"https://www.appsheet.com/image/getimageurl?appName=TDAD-4002500&tableName=Inicio&fileName=Inicio_Images%2F2.Imagen-.152423.jpg&appVersion=1.000015&signature=564bb7ef3b51565d88600f9aa135d982ef760f0033c8d1d5cbaa23e725c9ef17\"]",
